import { useLocation, useParams } from 'react-router-dom';

function Detail(props) {
    const Location = useLocation().pathname;

    let saveId = []

    for(let i = ni(Location.length-1) ; i <= 0 ; i--){
        if(Location[i] == "/"){
            break;
        }else{
            saveId.unshift(Location[i])
        }
    }
    console.log(saveId)
    

    return (
        <>
       <p1>{Location}</p1>
       </>
        );
    }
export default Detail;
